import React from 'react';
import ReactDOM from 'react-dom';

const header = () => {
  return (
    <div>
        <div id="title_text_div"> <h3>cryptofeeder.com</h3> </div>
        <div id="login_signup_button_div">
            <button id="login_button" class="button_primary">Login</button>
            <button id="signup_button" class="button_primary">Sign Up</button>
        </div>
    </div>
    )
};
